import React from 'react';
import { Typography, Box } from '@material-ui/core';

const ServiceHeading = () => {
    return (
        <>
            <Box py={2}>
                <Typography align="center" variant="h4">What Do We Offers</Typography>
                <Typography align="center" variant="subtitle1">Lorem ipsum dolor sit amet consectetur adipisicing elit. Soluta, voluptatum.</Typography>
            </Box>
        </>
    )
}

export default ServiceHeading;
